import React from "react";
import { Link } from "@reach/router";

const ArticleCard = props => {
  return (
    <>
      <li>
        <p>{props.date}</p>
        <p>{props.topic}</p>
        <h4>
          <Link to={`/articles/${props.key}`}>{props.title}</Link>
        </h4>
        <p>{props.comments}</p>
      </li>
    </>
  );
};
export default ArticleCard;
